import Page from "./Common_page/Page";
const Home = () => {
  return (
    <>
      <body
        style={{
          backgroundImage: `url("https://via.placeholder.com/500")`,
        }}
      >
        <div>
          <Page name="Login Page !" />
        </div>
      </body>
    </>
  );
};

export default Home;
